デュアルファン構成へのアップグレードも可能なCDC技術採用スリムタワーCPUクーラー&#160;<br><br>- LGA2011/1366/1156/1155/775、Socket AM3+/AM3/AM2+/AM2/FM1に対応<br>- 台座がヒートパイプでできているCDC技術を採用<br>- 静音性能と冷却性能を両立するワイドレンジPWMファンを使用<br>- 防振パッド付きファンで静音性を大きく向上<br>- ファンの取り付けが簡単なクイックスナップファンブラケットを採用<br>- 使用環境に合わせて120mmファンを後から追加してデュアルファン化が可能<br>- ファンの回転数が低くても一定以上の冷却性能を発揮する独自のフィン設計<br>- 1組であらゆるCPUソケットに対応するマルチリテンションブラケットを採用<br><br><style type="text/css">
