高さ27.4mm！Thin Mini-ITX、1Uサーバーに最適<br>1ボール１スリーブベアリング採用80mm PWM 4ピンファン搭載。<br>Intel／AMD両対応。付属クリップの付け替えで対応します。<br>溶接されたアルミニウムフィンとヒートパイプは高い熱伝導効率を保証します。<br>6mm径×2本の銅製ヒートパイプが発熱部分から直接冷却します。<br>TDP 95WまでのCPUに対応します。<br>保証期間：メーカー保証<br><br><style type="text/css">
