箱から開けてグリスを塗って、プッシュピンを押し込むだけの簡単インストール。<br>行き59mmのナロータイプフィンと、虎徹のハイエアフローなフィン設計を継承した「ファンの風を最も効率良く吸い込む」エアフ厚みのある5mmの銅製受熱ベースプレートと、各ヒートパイプの形状に合わせて成型された 『高精度ベース構造』により、CPUの発熱を確実に吸い上げます。<br>低回転～高回転まで、どの回転数にも最適な冷却性能を発揮するヒートシンク設計。<br>極静音モードからカジュアルなオーバークロックまでをサポート！<br>E.C.M.Sクリップ採用<br>Intel ソケット：775/1150/1155/1156/1366/1151<br>AMD ソケット：非対応<br>保証期間：メーカー保証<br><br><style type="text/css">
